Actionscript.script:
//动作类型 = _root.getItemData(_parent.刀).actiontype
if(_parent.兵器动作类型=="短兵" || _parent.兵器动作类型=="短柄" || _parent.兵器动作类型=="短刀"){
	gotoAndPlay("短柄");
}else if(_parent.兵器动作类型=="双刀"){
	gotoAndPlay("双刀");
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
